CREATE TABLE user(
    user_account VARCHAR(32) NOT NULL   COMMENT '接包人账号' ,
    user_name VARCHAR(32)    COMMENT '接包人名称' ,
    user_password VARCHAR(128)    COMMENT '接包人密码' ,
    working_hours1 TIME    COMMENT '工作开始时间' ,
    working_hour2 TIME    COMMENT '工作截至时间' ,
    working_hours3 TIME    COMMENT '工作开始时间(周末)' ,
    working_hour4 TIME    COMMENT '工作截至时间(周末)' ,
    working_area VARCHAR(32)    COMMENT '可工作区域' ,
    professional_status VARCHAR(32)    COMMENT '职业状态' ,
    professional_direction VARCHAR(32)    COMMENT '职业方向' ,
    specific_professional VARCHAR(32)    COMMENT '具体职业' ,
    work_experience VARCHAR(1024)    COMMENT '工作经历' ,
    education_experience VARCHAR(32)    COMMENT '教育经历' ,
    real_name VARCHAR(32)    COMMENT '真实姓名' ,
    Id_card VARCHAR(128)    COMMENT '身份证' ,
    PRIMARY KEY (user_account)
) DEFAULT CHARSET=utf8;

CREATE TABLE project_manager(
    manager_account VARCHAR(32) NOT NULL   COMMENT '项目经理账号' ,
    manager_name VARCHAR(32)    COMMENT '项目经理名称' ,
    manager_password VARCHAR(128)    COMMENT '项目经理密码' ,
    manager_telephone VARCHAR(32)    COMMENT '项目经理联系电话' ,
    manager_email VARCHAR(32)    COMMENT '项目经理邮箱' ,
    PRIMARY KEY (manager_account)
)  DEFAULT CHARSET=utf8;

CREATE TABLE administrator(
    administrator_account VARCHAR(32) NOT NULL   COMMENT '管理员账号' ,
    administrator_name VARCHAR(32)    COMMENT '管理员名称' ,
    administrator_password VARCHAR(128)    COMMENT '管理员密码' ,
    administrator_email VARCHAR(128)    COMMENT '管理员邮箱' ,
    administrator_telephone VARCHAR(128)    COMMENT '联系电话' ,
    PRIMARY KEY (administrator_account)
) DEFAULT CHARSET=utf8;

CREATE TABLE item(
    item_id VARCHAR(32) NOT NULL   COMMENT '项目id' ,
    item_name VARCHAR(128)    COMMENT '项目名称' ,
    manager_account VARCHAR(32)    COMMENT '项目经理账号' ,
    item_type VARCHAR(32)    COMMENT '项目类型' ,
    item_detail VARCHAR(1024)    COMMENT '项目详情' ,
    position_requirements VARCHAR(32)    COMMENT '岗位需求' ,
    skill VARCHAR(32)    COMMENT '技能' ,
    security_level VARCHAR(128)    COMMENT '安全等级' ,
    cycle VARCHAR(32)   COMMENT '周期' ,
    budget DECIMAL(32,8)    COMMENT '预算' ,
    desired_continuation_type VARCHAR(32)    COMMENT '希望承接类型' ,
    regional VARCHAR(128)    COMMENT '地域' ,
    contact_name VARCHAR(128)    COMMENT '联系姓名' ,
    email VARCHAR(128)    COMMENT '邮箱' ,
    phone_number VARCHAR(32)    COMMENT '联系电话' ,
    item_progress VARCHAR(32)    COMMENT '项目状况' ,
    PRIMARY KEY (item_id),
    constraint ma_pma foreign key(manager_account)
                   references project_manager(manager_account)
) DEFAULT CHARSET=utf8;

CREATE TABLE task(
    task_id VARCHAR(32) NOT NULL   COMMENT '任务id' ,
    task_name VARCHAR(32)    COMMENT '任务名称' ,
    item_id VARCHAR(32)    COMMENT '项目id' ,
    task_information VARCHAR(1024)    COMMENT '任务详情' ,
    task_state VARCHAR(32)    COMMENT '任务状态' ,
    task_feedback VARCHAR(32)    COMMENT '任务反馈' ,
    task_score VARCHAR(32)    COMMENT '任务评分' ,
    PRIMARY KEY (task_id),
        constraint itemid_itemids foreign key(item_id)
                   references item(item_id)
) DEFAULT CHARSET=utf8;

CREATE TABLE user_task(
    user_account VARCHAR(32) NOT NULL   COMMENT '接包人账号' ,
    item_id VARCHAR(32)    COMMENT '项目id' ,
    task_id VARCHAR(32)    COMMENT '任务id' ,
    task_state VARCHAR(32)    COMMENT '状态' ,
    constraint utuid_uid foreign key(user_account)
                   references user(user_account),
    constraint utiid_iid foreign key(item_id)
                   references item(item_id),
    constraint uttid_tid foreign key(task_id)
                   references task(task_id)               
) DEFAULT CHARSET=utf8;

CREATE TABLE item_member(
    item_id VARCHAR(32)    COMMENT '项目id' ,
    user_account VARCHAR(32)    COMMENT '接包人账号',
    constraint umuid_uid foreign key(user_account)
                   references user(user_account),
    constraint umiid_iid foreign key(item_id)
                   references item(item_id)   
) DEFAULT CHARSET=utf8;

CREATE TABLE safelog(
    id VARCHAR(32) NOT NULL   COMMENT 'id' ,
    user_account VARCHAR(32)    COMMENT '成员id' ,
    name VARCHAR(128)    COMMENT '姓名' ,
    login_authentication VARCHAR(1)    COMMENT '登陆验证' ,
    attendance_verification VARCHAR(1)    COMMENT '考勤验证' ,
    access_authentication VARCHAR(1)    COMMENT '访问验证' ,
    login_equipment VARCHAR(128)    COMMENT '登陆设备' ,
    login_address VARCHAR(128)    COMMENT '登陆地址' ,
    PRIMARY KEY (id),
    constraint sluid_uid foreign key(user_account)
                   references user(user_account)    
) DEFAULT CHARSET=utf8;

CREATE TABLE attendance(
    attendance_id VARCHAR(128) NOT NULL   COMMENT '考勤id' ,
    item_id VARCHAR(32)    COMMENT '项目id' ,
    user_account VARCHAR(32)    COMMENT '成员id' ,
    card VARCHAR(32)    COMMENT '身份' ,
    authentication VARCHAR(1)    COMMENT '身份验证' ,
    start_time TIME    COMMENT '开始工作时间' ,
    deadline TIME    COMMENT '结束工作时间' ,
    PRIMARY KEY (attendance_id),
    constraint atuid_uid foreign key(user_account)
                   references user(user_account),
    constraint atiid_iid foreign key(item_id)
                   references item(item_id)     
) DEFAULT CHARSET=utf8;





















